// Cash.js
import React, { useState, useEffect } from "react";
import { getCash } from "../api/CashApi";

const Cash = ({ userId }) => {
  const [cashData, setCashData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    if (userId) {
      const fetchCash = async () => {
        try {
          const data = await getCash(userId);
          setCashData(data);
          setLoading(false);
        } catch (error) {
          setError(error.message);
          setLoading(false);
        }
      };

      fetchCash();
    }
  }, [userId]);

  if (loading) return <div>Loading cash data...</div>;
  if (error) return <div>Error fetching cash data: {error}</div>;

  return (
    <div>
      <h2>Cash Details</h2>
      {/* Render cashData here */}
      {cashData && (
        <div>
          <p>Cash Balance: ${cashData.balance}</p>
          <p>Net Liquidity: ${cashData.net_liquidity}</p>
        </div>
      )}
    </div>
  );
};

export default Cash;
